column8:
長年、プロの方に信頼されています。

前面フラットパネルで美しさと実用性をプラス！

前面部から出っ張りを無くしたため、ひっかかることがありません。

オール鉄製：巻取ドラム全体が全て鉄製です。

スタッドボルト貫通式の強靭構造です。

フレーム：ハタヤ独自の折り曲げフレームは、持ち運びやすいグリップを上部に、仰向けにおいた時に安定する凸部を背面部に一体に形成しています。

コンセント：熱硬化性コンセントですから高負荷にも安心です。


●種別： 100V型タイプ(屋内型)&nbsp;

●コンセント個数： 4&nbsp;

●コンセント定格： 2P・15A・125V&nbsp;

●電線長さ(m)： 30&nbsp;

●材質： 円盤：鉄板製&nbsp;

●質量(kg)： 5.8&nbsp;

●コンセント形状： 二極&nbsp;

●寸法(高さH×幅W×奥行D)(mm)： 324×230×181&nbsp;

